def find_factors(n):
    factors = []
    for i in range(1, n + 1):
        if n % i == 0:
            factors.append(i)
    return factors

def is_square(n):
    if len(find_factors(n)) == 5:
        return True
    else:
        return False

def is_fourth_power(n):
    if len(find_factors(n)) == 5:
        return True
    else:
        return False

def is_product_of_two_primes(n):
    factors = find_factors(n)
    if len(factors) == 2 and factors[0] > 1 and factors[1] > 1:
        return True
    else:
        return False

